import React from "react";
import { Box, Flex } from "@chakra-ui/react";
import Sidebar from "./Sidebar";
import { Outlet } from "react-router-dom";

const AdminPanel = () => {
  return (
    <Flex>
      <Sidebar />
      <StickyNavbar />

      <Box ml="200px" p={6} w="full">
        <Outlet />
      </Box>
    </Flex>
  );
};

export default AdminPanel;
